To solve this problem, we need to determine if we can move at least one robot to the upper-left corner of the grid without causing any robots to explode. The solution involves checking if there exists a robot that can be moved to the upper-left corner using a sequence of commands such that all other robots remain within the grid during each command.

### Approach
1. **Identify Key Positions**: Track the minimum row and column positions among all robots. Specifically, find the robot with the smallest row index. Among all robots in that smallest row, find the one with the smallest column index.
2. **Check Validity**: Verify if all other robots have row indices greater than or equal to the minimum row index. For robots in the same minimum row, ensure their column indices are greater than or equal to the minimum column index found in the first step. If all robots satisfy these conditions, it is possible to move the identified robot to the upper-left corner without any explosions.

### Solution Code
```cpp
if (i < x1) {
    x1 = i;
    y1 = j;
} else if (i == x1 && j < y1) {
    y1 = j;
}
x2 = min(x2, i);
y2 = min(y2, j);
```

### Explanation
1. **Tracking Minimum Row and Column**: The variables `x1` and `y1` are used to track the smallest row and the smallest column within that row. This ensures we identify the robot closest to the upper-left corner.
2. **Global Minimum Check**: The variables `x2` and `y2` track the smallest row and column globally across all robots. This helps in verifying if the identified minimum row and column are indeed the smallest possible values.
3. **Validation**: By comparing `x1` with `x2` and `y1` with `y2`, we ensure that the identified robot's position is the smallest possible, allowing all other robots to stay within the grid during the necessary movements.

This approach efficiently checks the necessary conditions using two passes through the grid, ensuring the solution is both optimal and correct.
